objet:
l'association est un cercle de réflexion et de propositions (Think-Tank) , traitant des grands sujets liés à la préservation et à la promotion de l'identité française ; Elle a pour but de favoriser la recherche fondamentale et appliquée dans ces domaines ; 
L'Association pourra  : 
- éditer des ouvrages, articles, rapports, et procéder à leur diffusion
- organiser ou participer à des colloques, séminaires, conférences, débats, élections, etc ; 
Elle est propriétaire de sa marque déposée « Cercle Heres » et de tous les droits directs et indirects qui lui sont attachés ;

favoriser et garantir le libre choix de l'école, conformément au droit naturel des parents à l'éducation et à l'instruction de leurs enfants, selon leur conscience  ; 
promouvoir le caractère propre de l'Enseignement catholique, exprimé dans le projet éducatif de l'établissement, en collaboration avec ses responsables et les organismes concernés  ; 
mettre en uvre et faire connaitre le projet du mouvement des Apel et renforcer le sentiment d'appartenance à un mouvement national ;  A cet effet, l'association adhère à l'Apel de l'académie de Corse, elle-même membre de l'Apel nationale  ; 
réunir toutes les personnes investies de l'autorité parentale à l'égard des enfants scolarisés dans l'établissement et assurer leur information  ; 
représenter les familles auprès des pouvoirs publics et de toutes autorités civiles ou religieuses, et plus généralement auprès des tiers  ; 
étudier toutes questions se rattachant à l'éducation des enfants, à leurs droits et leurs devoirs et ceux de leur famille  ; 
permettre une entraide mutuelle des familles de l'établissement  ; 
participer à la vie de la communauté éducative et la promouvoir, dans le respect des compétences de chacun  ; 
apporter son soutien à l'établissement et contribuer à son animation ;

défense des droits et intérêts des locataires sur toutes les questions concernant l'habitat, l'urbanisme, les loyers, les charges locatives et autres prestations, la sécurité et la tranquillité des familles, la santé publique
  ; 
amélioration du cadre de vie des habitants, l'entraide et la solidarité  ; 
accueil, l'écoute et l'orientation de tout habitant qui en fait la demande  ; 
concertation et implication des habitants sur tous les projets de développement du quartier  ; 
organisation ponctuelle d'événements festifs, culturels, artistiques, sportifs
assurer l'organisation des rencontres entre le bailleur, la municipalité, les locataires et tout autre interlocuteur pertinent, sur toutes les questions ayant un impact sur le cadre bâti et non bâti, les équipements intérieurs et extérieurs, les mutations, les échanges, les constructions, l'entretien des bâtiments, la voirie, les espaces verts, 
 Par son action, l'association assure un rôle de veille sur toute question ayant un lien avec ces objectifs

cette association a pour but notamment : 
d'apporter et d'acheminer une aide alimentaire, éducative et sportive aux enfants du Sud-Est marocain par la diffusion de connaissances et la distribution de denrées non périssables, de matériels et d'équipements éducatifs et sportifs en participant à une ou plusieurs éditions du rallye-raid humanitaire 4L TROPHY, en partenariat avec l'association « Enfants du Désert » ; 
d'organiser en son nom ou de co-organiser des journées d'information et/ou de formation en vue de l'acheminement des biens et denrées susvisées dans le cadre du rallye-raid humanitaire 4L TROPHY, en partenariat avec l'association « Enfants du Désert » ; 
de promouvoir des actions éducatives et/ ou informatives à destination de toute la population et plus généralement de toutes personnes intéressées par les actions éducatives conduites dans le cadre du rallye-raid humanitaire 4L TROPHY, en partenariat avec l'association « Enfants du Désert », à destination des enfants du Sud-Est marocain ; 
de manière générale de mettre en uvre tous moyens et actions appropriés de nature à améliorer les conditions de vie et d'enseignement des enfants du Sud-Est marocain ; 
les actions ont vocation à bénéficier à l'ensemble de la population dès lors que l'éducation des enfants est un facteur clé du développement et du bien-être de la population ;

production, l'organisation et la promotion de toute forme de création de spectacle vivant (musique, chanson, théâtre, danse, cirque, festival
) ,  la production, l'organisation et la promotion de toute forme de création d 'art plastique et architecturale, la production, l'organisation et la promotion de toute création audiovisuelle (bandes sonores, vidéo, cinématographe, photographie
) , la production, l'organisation et la promotion d'évènements artistiques, festivals, bals ou toutes autres réunions festives, l'édition de toutes ces créations par tous les moyens de communication, et plus généralement toutes opérations industrielles, commerciales ou financières, mobilières ou immobilières, pouvant se rattacher directement ou indirectement à l'objet social ou susceptibles d'en faciliter l'extension ou le développement ; 
Sa durée est illimitée ;

permettre à tous d'accéder à des pratiques culturelles et sportives, notamment par le biais de la pratique des Arts martiaux et de toute activité permettant le développement physique et mental de ses adhérents ; 
Promouvoir et  développer de toutes activités sportives de loisirs ; 
Assurer également le développement et la promotion des fonctions éducatives, sociales et culturelles du sport en général ;

proposer aux parents d'élèves de l'école de Sagone ainsi qu'à leurs proches, ds animations festives ou culturelles (kermesse, spectacles, lotos, tombola, soirées animées, vide grenier, bourses aux livres, goûters
) ; 
Les fonds récoltés par l'association Scola Viva, pourront servir au financement des sorties scolaires, à l'achat de matériel pédagogique pour les enfants de l'école de Sagone ou au financement d'intervenants extérieurs ;

l'association à pour but d'organiser des événements sportifs et culturels afin de récolter des fonds et des dons pour aider à financer la recherche contre la mucoviscidose ; 
A soutenir financièrement les familles de patient vivant en Corse lors des longues hospitalisation sur le continent  et subventionner du matériel lié à la maladie ; 
A améliorer la qualité de vie au quotidien et à sensibiliser les personnes sur cette maladie génétique

