cette association permettra de nous réunir, (Habitants d'Afa et de la Communauté d'Agglomération du Pays Ajaccien) pour créer, animer, organiser, penser, autant que faire se peut, la pieuse Confrérie d'Afa ; 
Nous désirons promouvoir l'âme et la noblesse de cur et d'esprit, participer à toutes manifestations religieuses et oeucoméniques, mais aussi accompagner les plus démunis et ceux qui sont dans la souffrance, par des actes de bienfaisance et des uvres de charité ; 
Nous désirons éduquer, développer, favoriser des activités à caractère culturel, sportif et social dans le respect de l'éthique chrétienne, ainsi que promouvoir la solidarité sous toutes ses formes notamment en développant des activités de prévention, de formation et d'animation à caractère culturel, sportif et social en direction des jeunes et de la famille, pour notre village ;

l'association a pour objet : 
