aider à tous les moments de leur existence toute famille ou personne habitant dans les communes et les quartiers où elle exerce son action ; Pour ce faire, elle assure la responsabilité matérielle et morale de la marche d'une ou plusieurs branches d'activité pouvant concourir à la réalisation de cet objectif ; Elle est, ou peut devenir, employeur de toutes les personnes utiles à cette action du social,  du médico-social et du sanitaire, notamment dans le domaine de la vie quotidienne, du socio-éducatif, de la santé, ainsi que du développement local, conformément au règlement intérieur agréé par l'Union nationale des associations ADMR ; 
- développer un climat familial et d'intensifier les courants de solidarité, la vie sociale et l'animation dans les communes qu'elle dessert en faisant participer les familles, notamment celles ayant bénéficié de l'action de l'association ; 
- mettre en place l'accueil collectif de mineurs

concourir au développement de l'exercice interdisciplinaire des URPS libéraux qui la composent (URPS- membre) ; 
Élaborer chaque année un programme de travail composé d'actions que tout ou partie des URPS la composant souhaite mutualiser dans les missions qui leur sont confiées par l'article R ; 4031-2 du Code de la Santé Publique ; 
Exercer toute mission qui lui est dévolue par les URPS- membre la composant ; 
Représenter une profession dans le cadre d'un mandat explicitement donné par l'URPS-membre correspondante ;

de veiller au maintien des principes de moralité, de probité et de dévouement indispensables à l'exercice de la profession de sage-femme et à l'observation, par tous ses membres, des devoirs professionnels, ainsi que des règles édictées par le code de déontologie ;  - d'assurer la défense de l'honneur et de l'indépendance de la profession de sagefemme ; 
- d'organiser toutes uvres d'entraide et de retraite au bénéfice de ses membres et de leurs ayants droit ; 
Le conseil départemental est également chargé de plusieurs attributions spécifiques, prévues par l'article L ; 4123-1 du Code de la santé publique : 
- Il statue sur les inscriptions au tableau ; 
- Il autorise le président de l'ordre à ester en justice, à accepter tous dons et legs à 
l'ordre, à transiger ou compromettre, à consentir toutes aliénations ou hypothèques et à contracter tous emprunts ; 
- En cas de préjudice direct ou indirect à l'intérêt collectif de la profession de sage-femme, le conseil départemental peut, devant toutes les juridictions, exercer tous les droits réservés à la partie civile ; 
- Il peut créer avec les autres conseils départementaux de l'ordre et sous le contrôle du conseil national, des organismes de coordination ;

de rechercher et de développer tous moyens de nature à assurer un développement harmonieux des Sport de Pleine Nature, qui garantissent la sécurité des personnes, la conservation des espaces naturels et d'une manière générale, la qualité des organisations ; 
