fédérer sur le socle de la sororité et en dépassant tout clivage, les femmes engagées de Corse pour créer un réseau d'entraide féminine dans des domaines de compétence multiples ; 
Unir, réunir de façon inclusive : Présidentes d'association, femmes politiques, femmes du système éducatif, de santé, de la formation et de l insertion professionnelles, du monde syndical, cheffes d'entreprise, agricultrices, créatrices, auteures, journalistes, mères de famille, étudiantes, issues du monde citadin, rural, culturel, social, sportif ; 
Défendre les droits et places de toutes les femmes subissant des discriminations, quelles que soient leur couleur de peau, leurs origines, leurs religions, leurs orientations sexuelles, leur identité de genre, leurs statuts, classes sociales, leurs handicaps, leur apparence ; 
Participer à la protection d une société laïque et égalitaire ( contraception  avortement, libre disposition de son corps, égalité dans le monde du travail, représentativité dans la vie politique, favorisant le respect des droits des femmes ; 
Lutter contre les violences physiques, sexuelles et morales exercées contre elles ( le harcèlement sexuel, l'usage sexiste de l'image de la femme, la prostitution subie ou forcée, la différenciation de traitement scolaire en fonction du genre) par l'interaction de plusieurs acteurs spécialistes de ces sujets ; 
Donne e Surelle accueille toutes les femmes qui en font la demande qui partagent ces valeurs d'entraide et de partage ; 
D&S oriente les femmes vers les interlocutrices dédiées qui sauront répondre à leurs besoins spécifiques grâce à un contact et un accompagnement personnalisés ;

cette association a pour but de promouvoir la Corse et tout ce que l'on peu y trouver en mettant l'accent sur les avantages à y venir en hors saison ; 
l'association entend mettre en place des partenariats professionnels et se faire sponsoriser afin de pouvoir assister à de nombreux salons du tourisme local, national et international ; 
