développer des activités artistiques et culturelles en lien avec l'Archéologie, l'Art et l'Audiovisuel, au niveau régional, national et international ; favoriser l'éducation artistique et culturelle ; promouvoir le patrimoine et la culture corse ; 
Dans le domaine de l'archéologie, des actions de recherche, de diffusion de l'information, de formation auprès de tous types de public seront réalisées en collaboration avec des partenaires publics et privés afin de valoriser le patrimoine archéologique ; 
Dans le domaine de l'Art, des actions de sensibilisation, de formation et de valorisation en lien avec la bande dessinée et autres types artistiques seront menées auprès de tous types de public ; 
Dans le domaine de l'Audiovisuel, des actions seront menées pour favoriser la création et la diffusion de projets ouverts sur la société contemporaine auprès de tout public ; 
Des transversalités entre les trois disciplines pourront faire l'objet de projets interdisciplinaires ; 
L'association ARTEFACT mettra en uvre cet objet bénévolement, par le biais de prestations, ou de ventes de produits liées aux activités de l'association (se référer à l'article 9) ;

cette association a pour but d'initier, promouvoir et soutenir toutes actions visant à : étudier et transmettre diverses approches, cultures, disciplines traditionnelles ou modernes permettant de vivre de façon plus apaisée, de retrouver sa propre unité et l'harmonie avec les autres et son environnement, dans le respect des valeurs, de la culture, des croyances, religion, spiritualité, et du cadre de référence de chacun ; 
-éudier, concevoir, transmettre, des pratiques cohérentes et complémentaires, afin de trouver, adapter, des réponses à la souffrance psychique et au stress de la personne, de lui permettre de mettre du sens et d'organiser sa représentation du monde, de la responsabiliser par rapport à sa propre santé mentale et physique, en sortant du consumérisme et de la passivité quant à son hygiène de vie ;éudier et transmettre les méthodes et les savoirs permettant de découvrir et travailler sa richesse et sa créativité intérieures, de renforcer l'estime de soi et de retrouver la paix intérieure en se centrant sur l'être et non sur l'avoir ;-	prodiguer et transmettre notamment des séances de sophrologie, hypnose, PNL, DECEMO©, Access Consciousness©, soins énergétiques, ayurveda, vastu, Jyotish, yoga, magnétisme, radiesthésie, massages de bien-être, réflexologie, lithothérapie, psychothérapie, kinésiologie, en cabinet ou à domicile ainsi que la vente de produits en relations avec les soins prodigués ; 
toutes ces activités peuvent être exercées directement ou indirectement et notamment par voie de création de nouveaux établissements, d'apport, de prise en location-gérance ;et d'une manière plus générale, toutes opérations financières, mobilières ou immobilières pouvant se rattacher directement ou indirectement à l'objet de l'association ou à des objets connexes et susceptibles d'en faciliter le développement ou la réalisation ;

l'association AAFE, est une association intermédiaire, c'est à dire une structure d'accompagnement à la formation et à l'insertion professionnelle ; 
elle développe des activités de formation, de conseil, d'ingénierie, de validation d'acquis, de formation de formateurs en France et à l'international ; 
elle a pour objet le développement d'une coopération concertée dans les domaines de la formation continue, en général ; 
