elle propose des actions et des pistes pour toute personne souhaitant voir évoluer son statut professionnel ou simplement éducatif ; 
l'association d'aide à la formation et à l'emploi, AAFE, est un interlocuteur privilégié pour répondre aux appels d'offres d'emploi et se propose d'accompagner quiconque la contactera pour la formation et la recherche d'un emploi adapté ;

créer ou accompagner les actions et les projets visant à faire reculer la pauvreté et les inégalités dans différents domaines : mobilité, alimentation, santé, logement, handicap, lutte contre les discriminations, formation et insertion professionnelle, jeunesse ; 
créer ou accompagner les actions et les projets visant à assurer l'équilibre territorial, le lien intergénérationnel, la cohésion sociale, l'entraide et la solidarité ; 
mettre en synergie, permettre ou créer les partenariats entre les personnes morales publiques ou privées, et les personnes physiques, qui aspirent à la concrétisation des objectifs précédents ; 
