contribuer à l'épanouissement et à la formation globale des jeunes, des hommes et des femmes, par la pratique volontaire de la vie de groupe, la confrontation, le partage, par la valorisation et la découverte d'expressions artistiques, culturelles, sportives ou scientifiques ; Organiser des activités éducatives, sociales, culturelles et de loisirs pour tous ; La gestion et l'animation de toutes réalisations éducatives,  centres de loisirs avec ou sans hébergement permanents ou non, centres de vacances, maison de l'Enfance, animations de quartiers, points informations jeunesse, ateliers, etc ; 
