réfléchir aux actions politiques à mettre en uvre pour promouvoir une vision progressiste pour l'europe, à l'échelle locale, nationale, européenne et internationale ; 
l'association pour une renaissance européenne corse vise à créer un cadre de pensée et d'action propice à faire vivre le projet européen pour une europe souveraine, unie et démocratique, porté par le président de la république, Emmanuel Macron lors du discours de la sorbonne  ; 
les valeurs et principes européens défendus par l'association portent notamment le projet de faire de l'europe la première puissance verte, la force régulatrice de la mondialisation, le plus large espace de justice sociale et fiscale ainsi que le fer de lance des droits démocratiques et des droits des femmes et des minorités sexuelles, et de l'éducation pour tous ; 
s'efforce à inclure les citoyens dans le renouvellement des idées, à travers des consultations citoyennes, des rencontres avec les habitants ; contribue à l'action collective au service de la citoyenneté européenne et du rapprochement entre les institutions européennes et les citoyens, en lien avec l'ensemble des acteurs de la société civile, notamment associatifs ;

