l'objet social de l'association est d'animer et développer le centre social sollacarais des arts de la terre ; 
l'association se caractérise par son engagement économique social et solidaire ;  à ce titre, elle agit comme un contributeur actif de l'inclusion sociale et professionnelle ; elle se positionne et se constitue à cet effet comme structure de l'insertion sociale par l'activité économique (siae) ;  
terrascola se dédie à la sensibilisation, l'apprentissage et la formation aux arts de la terre ; l'association s'inscrit dans une démarche de riacquistu, (terme spécifiquement Corse exprimant la réappropriation, le renouveau, ou encore le ressourcement du patrimoine culturel endémique) ;  au travers de son action, c'est le cur du lien social et l'expression de l'âme de notre terre de corse qu'il s'agit de transmettre et de contribuer à faire vivre ; 
l'association est en outre un acteur engagé du réseau des artisans de la terre de l'ornano-taravu-valinco-sartenais  (ressat otvs) et partenaire du petr otvs dans ses efforts de développement de l'attrait touristique identitaire du territoire, comme un écho à la richesse de ses sites préhistoriques (filitosa à sollacaro, cauria à sartène, etc) qui fondent une tradition de 8000 ans d'art céramique et des arts de la terre ; l'association s'inscrit ainsi pleinement dans l'axe culturel « la corse des origines »

